import React from "react";
import "./styling/home.css";
import "./scripts/typewriter";
import { Button, Typography } from "@material-ui/core";
const Home = () => {
  return (
    <div className="home">
      <section id="name" className="content">
        <h1>
          Shawn
          <br />
          Morreau
        </h1>
      </section>
      <h2 className="role anim-typewriter content">Software Engineer</h2>
      <section className="callToAction content">
          <Typography component="h2" variant="h5" className="text content">
              Check out my projects or let's talk about building your next project!
          </Typography>
        <Button variant="contained" color="primary" className="CTAButton titles">
          Projects
        </Button>
        <Button variant="contained" color="secondary" className="CTAButton titles">
          Contact
        </Button>
      </section>
    </div>
  );
};
export default Home;
